import React from "react";
import { Link } from "react-router-dom";
import "./kmHeader.css";

const kmHeader = () => {
  return (
    <div className="KmHeader">
      <Link className="back_link">
        <span className="back_icon">
          <ion-icon name="arrow-back"></ion-icon>
        </span>
      </Link>
    </div>
  );
};

export default kmHeader;
